BEGIN TRANSACTION;
DROP TABLE IF EXISTS "StockDividend";
CREATE TABLE IF NOT EXISTS "StockDividend" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"stockId"	TEXT NOT NULL,
	"year"	TEXT NOT NULL,
	"cashDividends"	DECIMAL(12 , 2),
	"stockDividends"	DECIMAL(12 , 2),
	"totalDividends"	DECIMAL(12 , 2)
);
DROP TABLE IF EXISTS "StockInfo";
CREATE TABLE IF NOT EXISTS "StockInfo" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"stockId"	TEXT NOT NULL,
	"name"	TEXT NOT NULL,
	"industry"	TEXT NOT NULL
);
DROP TABLE IF EXISTS "StockDetail";
CREATE TABLE IF NOT EXISTS "StockDetail" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"stockId"	TEXT NOT NULL,
	"yearSeason"	TEXT NOT NULL,
	"revenue"	DECIMAL(12 , 2),
	"profitAfterTax"	DECIMAL(12 , 2),
	"grossMargin"	DECIMAL(12 , 2),
	"operatingIncome"	DECIMAL(12 , 2),
	"profitAfterTaxPercentage"	DECIMAL(12 , 2),
	"roe"	DECIMAL(12 , 2),
	"eps"	DECIMAL(12 , 2)
);
COMMIT;
